import React, { Component } from "react";
import { Link } from 'react-router-dom';
import axios from 'axios';
import CarTable from './CarTable';
import Logout from './Logout';

export default class DisplayAllCars extends Component 
{
    constructor(props) 
    {
        super(props)
        this.state = {
            cars: []
        };    
        // timer is needed to allow the database change to take effect before getting the results
        setTimeout(() => {axios.get('http://localhost:4000/cars/')
                               .then(res => this.setState({cars: res.data}),
                               ((error) => console.log(error)), 200)}); // wait 200 milliseconds
  }


  render() {  
            let content = <div>
                            <CarTable cars={this.state.cars} /> 
                            <div className="add-new-car">
                              <Link className="blue-button" to={"/AddCar"}>Add New Car</Link>
                            </div>
                            <Logout/>
                          </div>

            if(localStorage.loggedIn === 'false')
            {
                content = <div>Access Denied</div>
            }
            return (           
              <div className="table-container">
                {content}
            </div>
    );
  }
}
